inline unsigned short read()
{
	unsigned short x = 0;
	char c = getc();//x代表返回值，c代表读取的字符
	while (c != ' ' && c != '\n') {
		x = x * 16 + ((c >= 'a') ? (c - 'a' + 10) : (c - '0'));
		c = getc();
	}
	return x;
}

